import React from 'react';
import login from '../assets/imgs/login.png';

const LoginPage = () => {
    return (
        <section className="h-screen w-screen">
            <div className="flex mx-auto my-auto flex-col mt-[50px]">
                <div className=" w-[50%] flex flex-col justify-center items-center">
                    <div className="">
                        <h3>Welcome Back!</h3>
                    </div>
                    <div>
                        <div>Username:</div>
                        <input type="text" />
                    </div>
                    <div>
                        <div>Password:</div>
                        <input type="text" />
                    </div>
                </div>
                <div>
                    <img src={login} alt="" />
                </div>
            </div>
        </section>
    );
};

export default LoginPage;
